import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from "./components/Home";
function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/" component={Home}/>
          {/* <Route path="/" component={Dashboard}/> */}
        </Routes>
    </Router>  
    </div>
  );
}

export default App;
